import React, { useState } from "react"
import { Link, useNavigate } from "react-router-dom"
import "../../components/common/AuthStyles.css"
import { authService } from "../../api/auth"

const LoginPage = () => {
  const [credentials, setCredentials] = useState({
    email: "",
    password: "",
  })
  const [error, setError] = useState("")
  const [successMessage, setSuccessMessage] = useState("")
  const [isLoading, setIsLoading] = useState(false)
  const navigate = useNavigate()

  const handleChange = e => {
    const { name, value } = e.target
    setCredentials(prev => ({
      ...prev,
      [name]: value,
    }))
  }

  const handleSubmit = async e => {
    e.preventDefault()

    // Очищаем предыдущие сообщения
    setError("")
    setSuccessMessage("")

    // Валидация полей
    if (!credentials.email || !credentials.password) {
      setError("Пожалуйста, заполните все поля")
      return
    }

    try {
      setIsLoading(true)
      console.log("Отправка данных на сервер:", { email: credentials.email })

      const response = await authService.login(credentials)
      console.log("Ответ сервера:", response)

      setSuccessMessage("Авторизация успешна! Перенаправление...")

      // Задержка перед перенаправлением
      setTimeout(() => {
        navigate("/dashboard")
      }, 1500)
    } catch (err) {
      console.error("Ошибка при авторизации:", err)

      // Обработка различных типов ошибок
      if (err.response) {
        // Ошибки от сервера
        if (err.response.status === 401) {
          setError("Неверный email или пароль")
        } else if (err.response.status === 403) {
          setError("Доступ запрещён")
        } else {
          setError(
            err.response.data?.message || "Произошла ошибка при авторизации"
          )
        }
      } else if (err.request) {
        // Ошибка сети - запрос был отправлен, но ответ не получен
        setError(
          "Сервер не отвечает. Пожалуйста, проверьте подключение к интернету."
        )
      } else {
        // Общая ошибка
        setError("Произошла ошибка при отправке запроса на авторизацию")
      }
    } finally {
      // setIsLoading(false)
    }
  }

  return (
    <div className="auth-container">
      <div className="auth-form-container">
        <div className="auth-header">
          <h1>Вход в систему</h1>
          <p>
            Введите свои данные для входа в систему управления клиентским опытом
          </p>
        </div>

        {error && <div className="error-message">{error}</div>}
        {successMessage && (
          <div className="success-message">{successMessage}</div>
        )}

        <form className="auth-form" onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="email">Email</label>
            <input
              type="email"
              id="email"
              name="email"
              className="form-control"
              value={credentials.email}
              onChange={handleChange}
              placeholder="Введите ваш email"
              disabled={isLoading}
              required
            />
          </div>

          <div className="form-group">
            <label htmlFor="password">Пароль</label>
            <input
              type="password"
              id="password"
              name="password"
              className="form-control"
              value={credentials.password}
              onChange={handleChange}
              placeholder="Введите ваш пароль"
              disabled={isLoading}
              required
            />
          </div>

          <button type="submit" className="submit-button" disabled={isLoading}>
            {isLoading ? "Выполняется вход..." : "Войти"}
          </button>
        </form>

        <div className="auth-footer">
          Нет аккаунта?
          <Link to="/register">Зарегистрироваться</Link>
        </div>
      </div>
    </div>
  )
}

export default LoginPage
